<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: center;"><b><span style="font-size: 16pt;">Salient Features at a Glance</span></b></p>
<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: center;"><b><span style="font-size: 16pt;"></span></b></p>
<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: justify;"><span style="font-size: 13pt; font-family: Kundli;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-size: 13pt;">Vaish Model Sr. Sec. School, an ambitious institution of Bhiwani is the culmination of vision, inspiration and zeal of worthy trustees of the Vaish Mahavidyalaya Trust (Regd.), Bhiwani, Haryana. Its foundation stone was laid down in 1980 by the benevolent hands of prominent social worker, veteran leader, renowned freedom fighter and former Chief Minister of Haryana, Late Sh. Banarasi Dass Gupta.</span></p>
<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: justify;"><span style="font-size: 13pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The idea of setting up such a model institution was first conceived in 1976. Late Shri Bhagirath Mal Buwaniwala and Late Sh. Gauri Shankar Bajaj did a lot of spade work as a result of which ,the school finally took concrete shape in 1980. The school has its own Managing Committee. Sh. K.K. Mohta has been the President since the beginning. Late Sh. G.S. Bajaj was the founder Secretary while Sh. Pawan Kumar Buwaniwala took charge as Secretary in April 1989. The school received its first affiliation to the Central Board of Secondary Education, New Delhi on 1<sup>st</sup> April 1991 and was further upgraded to the Senior Secondary level in April 1994. The School has an exemplary record in academics with Twenty Five batches of AISSE (X) and Twenty Two batches of AISSCE (XII) passing out by 2017. At present, the school caters to the needs of 5250 students from Nursery to XII in the hands of 193 worthy, hardworking, dedicated &amp; experienced teaching staff with due cooperation of 22 office employees and 60 supporting staff.</span></p>
<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: justify;"><span style="font-size: 13pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The school has been doing exceptionally well in Academics as well as Extra Curricular Activities for the last 37 years. A unique feature of the school is that students as well as staff is honoured every year by our very liberal and benevolent managing committee with Gold and Silver medals alongwith attractive cash prizes for excellent performance in Board results as well as Extra curricular activities at State and National Levels.</span></p>
<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: justify;"><span style="font-size: 13pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To spread the flame of education to all parts of society specially those living in remote north east region of the country, our managing committee is imparting free of cost education for the last 15 years to many students of that region who are living in the Vanvasi Kalyan Ashram, Bhiwani.</span></p>
<p style="margin-top: 0in; margin-right: 24.5pt; margin-bottom: 0.0001pt; text-align: justify;"><span style="font-size: 13pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The school has earned such a brand name and popularity that it has become the first choice of parents in the Bhiwani District for admissions of their wards. </span></p>
<p>&nbsp;</p>
