<p><b><span style="font-size: 13pt;">House Activities :-</span></b></p>
<p style="text-align: justify;"><span style="font-size: 13pt;">A well managed house system for the students &amp; teachers of the school has Love and Kush houses at Nur. &amp; K.G. level and Gandhi, Jawahar and Subhash houses from 1<sup>st</sup> to XII classes. House activities regularly take place from time to time throughout the session such as Poster making, Rakhi making, Debate, Poem recitation, Solo Dance, Food without Fire Competition, Kite Making, Mehandi Competition, Science Quiz, Maths Quiz etc.</span></p>
<p style="text-align: justify;"><b><span style="font-size: 13pt;">Rallies &amp; Campaigns </span></b><span style="font-size: 13pt;">:-</span></p>
<p style="text-align: justify;"><span style="font-size: 13pt;">To create awareness among the students as well as the society rallies and Campaigns related to social causes and awareness like Save Girl Child, Cleanliness Campaign, Freedom Run, Road Safety Week, Save Water, Rain Water Harvesting, Save Environment are organized from time to time.</span></p>
<p style="text-align: justify;"><b><span style="font-size: 13pt;">Awards &amp; Scholarship :-</span></b></p>
<p style="text-align: justify;"><span style="font-size: 13pt;">Awarding scholarships and awards to the students in academics and co-curricular activities is one of the unique features of the school of instance.</span></p>
<p style="text-align: justify;"><span style="font-size: 13pt;">During the session 2014-15, the school distributed scholarships of more than 7 lakh 30 thousand from 1<sup>st</sup> to XII classes. The teachers are also awarded for excellent board results. Students are also awarded with Gold plated silver medals for their achievements.</span></p>
